description:
Be blessed as we read through Revelation! We are introduced to this final book of the Bible by 

learning the author of Revelation, understanding the main point is Jesus Christ. As we examine common misconceptions of Revelation, take on the joy, peace and comfort welling in this book of prophecy.

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.  
